import React from "react";
import { Row, Col } from "react-bootstrap";
import profileImage from "../assets/profileImage.jpg";
import Banner from "./banner";

function Landing() {
  return (
    <div className="landing-grid">
      <Row>
        <Col>
          <Banner />
        </Col>
        <Col>
          <img src={profileImage} className="profileImage" alt="brandon" />
        </Col>
      </Row>

      <div className="aboutMeContainer">
        <h1>About Me</h1>
        <p>
          I'm a navy veteran who spent years in healthcare working with buggy
          software that spired my interest in coding. I spent my 2020 quarantine
          learning Javascript and building projects in React and am currently
          looking for a company to put my new skills to good use.
        </p>
      </div>
    </div>
  );
}

export default Landing;
